import lunarLanderImg from '../assets/LunarLanderProject.png'
import mangoLeafDiseaseClassificator from '../assets/MangoLeafDiseaseClassificatorProject.png'
import ProjectCards from './ProjectCards';

function BestProjects(){
    
    return (
        
        <div className="px-8 py-8 flex">
            <ProjectCards image={lunarLanderImg} description="Lunar Lander description"/>
            <ProjectCards image={lunarLanderImg} description="Mango Leaf Disease Classifier description"/>
        </div>
        
    );
}

export default BestProjects;
